NO CONTEST pleas entered to counts 2, 3 and 4; obstruct officer, possess cocaine and possess THC.  Convicted.
The State moves to dismiss and read in counts 1 and 5, fleeing an officer and possess drug paraphernalia.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for twelve (12) months.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Submit to random urine screens and pay for same;
3) Maintain absolute sobriety;
4) Complete thirty (30) hours of community service, on count 2 only;
5) Pay court costs;
6) pay supervision fees in an amount to be determined by DOC.
The Court further orders a cocaine assessment.
Minutes.
